    <p style="margin-top: 20px; line-height: 22px;">
        It is wise to discuss your test results with family, friends and colleagues in order to validate them. By doing
        so you can find out what they think about what type of person you are and how they look at your talents, skills
        and competences.
    </p>

    <p style="margin-top: 20px; line-height: 22px;">
        You can translate these findings back, in combination with your own competence assessment, to occupations that
        appeal to you and in which you think your competences come into their own the most. Keep in mind, as discussed
        earlier, it often happens that not all of your personality traits are reflected in a specific occupation.
    </p>

    <p style="margin-top: 20px; line-height: 22px;">
        However, you can make a shortlist of occupations that appeal to you and select one of those to start your career
        in. When you find the occupation or career field that you want to start your career in you should gather more
        information about the required background, skills and/or educational level.
    </p>

    <p style="margin-top: 20px; line-height: 22px; margin-bottom: 50px;">
        What does a regular day on the job looks like in this occupation? Or what tasks do they regularly perform? Answering questions like these will give you more insight in that specific occupation. Furthermore, this type of information is easy to find on the internet and will help you in making your career choices.

    </p>

